import React from "react";
import IInfos from "../../../types";


export default function Item({names}: {names: IInfos[] }){
    return(

        names.map((item, index) => (
        <li>
            {item.Entrada} | 
            {item.Licenseplate}  | 
            {item.Entrada}
        </li>
    )))


}
